  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The National Institute on Aging Genetics
  of Alzheimer's Disease Data Storage Site (NIAGADS) is a national genetics data repository
  facilitating access to genotypic and phenotypic data for Alzheimer's disease (AD).
  Data include GWAS, whole genome (WGS) and whole exome (WES), expression, RNA Seq,
  and CHIP Seq analyses. Data for the Alzheimeru2019s Disease Sequencing Project (ADSP)
  are available through a partnership with dbGaP (ADSP at dbGaP). Results are integrated
  and annotated in the searchable genomics database that also provides access to a
  variety of software packages, analytic pipelines, online resources, and web-based
  tools to facilitate analysis and interpretation of large-scale genomic data. Data
  are available as defined by the NIA Genomics of Alzheimeru2019s Disease Sharing
  Policy and the NIH Genomics Data Sharing Policy. Investigators return secondary
  analysis data to the database in keeping with the NIAGADS Data Distribution Agreement.</p>n\",\n\t\"license_title\":
